import React, { Component } from 'react';
import FriendUnit from './FriendUnit';

class FriendArray extends Component {

    constructor(props){
        super(props)
    }

    shouldComponentUpdate(){
        return true;
    }

    deleteArray = (friend) => {
        this.props.deleteArray(friend);
    }

    render() {
        return (
            <div>
                {this.props.request.map(
                    friend => (<FriendUnit key={friend.userID} friend={friend} deleteArray={this.deleteArray} from={this.props.from} />)
                )}
            </div>
        );
    }
}

export default FriendArray
